// Table.js
import React from 'react';
import Car from '../Car';

const tabelaCars = ({ cars, carsFiltered, onEdit, onDelete }) => {
  return (
    <table className="table table-striped">
      <thead>
        <tr>
          <th>Name</th>
          <th>Model</th>
          <th>Tip</th>
          <th>Akcija</th>
        </tr>
      </thead>
      <tbody>
        {carsFiltered.map((car, index) => (
          <Car
            key={index}
            car={car}
            onEdit={onEdit}
            onDelete={onDelete}
          />
        ))}
      </tbody>
    </table>
  );
};

export default tabelaCars;
